import React from 'react';

import Second_Of_Five from './image/hiking.jpg';

const Hiking = () => {
  const containerStyle = {
    background: `url(${Second_Of_Five})`,
    backgroundSize: 'cover',
    backgroundPosition: 'right',
    backgroundRepeat: 'no-repeat',
    position: 'relative', // Add relative positioning to the container
    zIndex: -1, // Set a negative z-index to move the container behind other components
    width: "750px",
    height: '500px', // Set the desired height for the background image container
    

  };
  const imageCreditStyle = {
    position: 'relative',
    bottom: '10px',
    right: '10px',
    background: 'rgba(0, 0, 0, 0)',
    color: '#000',
    padding: '25px 500px',
    fontSize: '10px',
    borderRadius: '4px',
    marginLeft: "100px"
  };


  return (
    <div>
      <div style={containerStyle} />
      <div style={imageCreditStyle}>
      <a href="https://www.freepik.com/free-vector/detective-hiding-concept-illustration_44996007.htm#query=hiking%20storyset&position=0&from_view=search&track=ais">Image by storyset on Freepik </a>{/* Replace with the actual image credit */}
      </div>
     
    </div>
  );
}

export default Hiking;
